import React from "react";

import PageTitle from "./PageTitle";
import Page from "./Page";
import { Company, getCompanies } from "../data/companies";
import { render } from "@testing-library/react";
import { Link } from "react-router-dom";

const DealerList = () => {
  const [companies, setCompanies] = React.useState<Company[]>();

  React.useEffect(() => {
    setCompanies(getCompanies());
  }, []);

  const renderBody = () => {
    console.log(companies);

    return companies?.map((company: Company) => {
      return (
        <tr>
          <td key={company.CompanyId}>{company.AccountNumber}</td>
          <td>{company.CompanyName}</td>
          <td>{company.Licenses}</td>
          <td>{company.LicensesMobileCount}</td>
          <td>{company.TrialLicenses}</td>
          <td>
            <Link to="">Update</Link>
          </td>
        </tr>
      );
    });
  };

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Account Number</th>
            <th>Company Name</th>
            <th>Desktop Licenses</th>
            <th>Mobile Licenses</th>
            <th>Trial Licenses</th>
          </tr>
        </thead>
        <tbody>{renderBody()}</tbody>
      </table>
    </div>
  );
};

export default DealerList;
